import React, { Component } from 'react'

class Form extends Component {
  state = {
    content: ''
  }
  
  render(){
    return (
      <div className="container">
        <form>
          <div className="row text-center">
            <div className="col-sm-4">11/29/2018</div>
            <div className="col-sm-4">November</div>
            <div className="col-sm-4">Week 5</div>
          </div>
        </form>
      </div>
    )
  }
}

export default Form
